import React from 'react';
import image from '../images/image2.png'
import App from '../App.css';

class card extends React.Component {
    render() {
        return (
            <React.Fragment>
                <div>
                <div className="card-content" draggable="true">
                    <span className="image"><img src={image}></img></span>
                    <span className="title">Title</span>
                    <span><a href=""> Assign to me</a></span>
                    <div>This is the link to your learning portal. Start here.</div>
                </div>
                </div>

            </React.Fragment>
        )
    }
}

export default card;
